import React from "react";
import "./Trip.css";
import TripData from "./TripData";

function Trip() {
  return (
    <div className="trip">
      <h1>Recent Trips</h1>
      <p>You can discover unique destination using Google Maps</p>
      <div className="trip-card">
      <TripData image={"/assets/.jpg"}/>
      </div>
    </div>
  );
}

export default Trip;
